import React, { useContext } from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import { SiteContext } from "../context/GlobalContext";
import { useNavigate } from "react-router-dom";

function Topbar() {
  const navigate = useNavigate();
  const contextInfo = useContext(SiteContext);
  console.log(contextInfo,"logUser");
  const handleUser = (val) => {
    if(val == 'log'){
      navigate("/login");
    }
    else{
      navigate("/register");
    }
   
  };
  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              Gold Leaf Construction Inc.
            </Typography>
            <Box sx={{ flexGrow: 1 }}>
              <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                Primary Portal
              </Typography>
            </Box>
            {
              !contextInfo.userLogged ?
                  <Button color="inherit" onClick={() => handleUser('log')}>
                    Login
                  </Button> :
                  <Typography variant="p" component="div" sx={{ flexGrow: 1, textAlign:'end' }}>
                    Welcome !
                  </Typography>
            }
            <Button color="inherit" onClick={() => handleUser('reg')} sx={{ marginLeft: '3px' }}>
              Register
            </Button>
          </Toolbar>
        </AppBar>
      </Box>
    </div>
  );
}

export default Topbar;
